  the National Park Service's (NPS) Inventory and Monitoring Program in conjunction
  with the Biological Resources Division (BRD) of the United States Geological Survey
  (USGS). This mapping effort was performed by Cogan Technology Inc. (CTI) under contract
  to the Pacific Island Inventory and Monitoring Network (UCBN) of the National Park
  Service.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
